import React from "react";
import { BrowserRouter, Route } from 'react-router-dom';
import Switch from 'react-router'
import Home from './pages';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
